import React, { useState } from 'react';
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  StyleSheet,
  SafeAreaView,
  Alert,
  Pressable,
} from 'react-native';
import { colors, spacing, typography, borderRadius, shadows } from '../../theme/colors';

const DocumentUploadScreen = ({ navigation, route }) => {
  const { service, provider } = route.params || {};
  const [uploadedDocs, setUploadedDocs] = useState({});

  const requiredDocuments = [
    {
      id: 'identity',
      title: 'Identity Proof',
      subtitle: 'Aadhaar Card / PAN Card / Passport',
      required: true,
    },
    {
      id: 'address',
      title: 'Address Proof',
      subtitle: 'Utility Bill / Rent Agreement',
      required: true,
    },
    {
      id: 'photo',
      title: 'Passport Photo',
      subtitle: 'Recent photograph',
      required: true,
    },
  ];

  const uploadDocument = (docId, method) => {
    const fileName = `${docId}_${Date.now()}.${method === 'pdf' ? 'pdf' : 'jpg'}`;
    const fileSize = Math.floor(Math.random() * 3000000) + 500000;
    
    setUploadedDocs(prev => ({
      ...prev,
      [docId]: {
        name: fileName,
        size: fileSize,
        method: method,
        date: new Date().toLocaleString(),
      }
    }));

    Alert.alert('Success!', `Document uploaded: ${fileName}`);
  };

  const showUploadOptions = (docId, docTitle) => {
    Alert.alert(
      `Upload ${docTitle}`,
      'Choose upload method:',
      [
        { text: 'Camera', onPress: () => uploadDocument(docId, 'camera') },
        { text: 'Gallery', onPress: () => uploadDocument(docId, 'gallery') },
        { text: 'PDF', onPress: () => uploadDocument(docId, 'pdf') },
        { text: 'Cancel', style: 'cancel' },
      ]
    );
  };

  const removeDocument = (docId) => {
    const newDocs = { ...uploadedDocs };
    delete newDocs[docId];
    setUploadedDocs(newDocs);
    Alert.alert('Removed', 'Document removed successfully');
  };

  const formatSize = (bytes) => {
    return (bytes / 1024 / 1024).toFixed(2) + ' MB';
  };

  const progress = {
    uploaded: requiredDocuments.filter(doc => uploadedDocs[doc.id]).length,
    total: requiredDocuments.length,
  };

  const canContinue = progress.uploaded === progress.total;

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <Pressable onPress={() => navigation.goBack()} style={styles.backButton}>
          <Text style={styles.backIcon}>‚Üê</Text>
        </Pressable>
        <View style={styles.headerContent}>
          <Text style={styles.headerTitle}>Upload Documents</Text>
          <Text style={styles.headerSubtitle}>
            {provider?.name || 'Provider'} ‚Ä¢ {service?.title || 'Service'}
          </Text>
        </View>
      </View>

      <ScrollView showsVerticalScrollIndicator={false}>
        {/* Progress */}
        <View style={styles.progressCard}>
          <Text style={styles.progressTitle}>
            Progress: {progress.uploaded}/{progress.total}
          </Text>
          <View style={styles.progressBar}>
            <View 
              style={[
                styles.progressFill, 
                { width: `${(progress.uploaded / progress.total) * 100}%` }
              ]} 
            />
          </View>
          <Text style={styles.progressText}>
            {canContinue ? '‚úì All documents uploaded!' : `${progress.total - progress.uploaded} more needed`}
          </Text>
        </View>

        {/* Documents */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Required Documents</Text>
          
          {requiredDocuments.map((doc) => {
            const uploaded = uploadedDocs[doc.id];
            
            return (
              <View key={doc.id} style={styles.docCard}>
                <View style={styles.docHeader}>
                  <View style={[styles.docBadge, uploaded && styles.docBadgeSuccess]}>
                    <Text style={styles.docBadgeText}>
                      {uploaded ? '‚úì' : doc.title.charAt(0)}
                    </Text>
                  </View>
                  <View style={styles.docInfo}>
                    <Text style={styles.docTitle}>{doc.title}</Text>
                    <Text style={styles.docSubtitle}>{doc.subtitle}</Text>
                  </View>
                </View>

                {uploaded ? (
                  <View style={styles.uploadedBox}>
                    <Text style={styles.uploadedText}>
                      üìÑ {uploaded.name}
                    </Text>
                    <Text style={styles.uploadedMeta}>
                      {formatSize(uploaded.size)} ‚Ä¢ {uploaded.method} ‚Ä¢ {uploaded.date}
                    </Text>
                    <View style={styles.buttonRow}>
                      <Pressable
                        onPress={() => showUploadOptions(doc.id, doc.title)}
                        style={styles.smallButton}
                      >
                        <Text style={styles.smallButtonText}>Replace</Text>
                      </Pressable>
                      <Pressable
                        onPress={() => removeDocument(doc.id)}
                        style={[styles.smallButton, styles.smallButtonDanger]}
                      >
                        <Text style={[styles.smallButtonText, styles.smallButtonTextDanger]}>
                          Remove
                        </Text>
                      </Pressable>
                    </View>
                  </View>
                ) : (
                  <Pressable
                    onPress={() => showUploadOptions(doc.id, doc.title)}
                    style={styles.uploadButton}
                  >
                    <Text style={styles.uploadButtonText}>Upload Document +</Text>
                  </Pressable>
                )}
              </View>
            );
          })}
        </View>

        {/* Continue */}
        <View style={styles.section}>
          <Pressable
            onPress={() => {
              if (canContinue) {
                navigation.navigate('FinalForm', { service, provider, documents: uploadedDocs });
              } else {
                Alert.alert('Missing Documents', `Please upload all ${progress.total} required documents`);
              }
            }}
            style={[styles.continueButton, !canContinue && styles.continueButtonDisabled]}
          >
            <Text style={styles.continueButtonText}>
              {canContinue ? 'Continue to Form ‚Üí' : `Upload ${progress.total - progress.uploaded} More`}
            </Text>
          </Pressable>
        </View>

        <View style={{ height: 40 }} />
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F8FAFC',
  },
  header: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 16,
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E2E8F0',
  },
  backButton: {
    marginRight: 12,
    padding: 8,
  },
  backIcon: {
    fontSize: 24,
    color: '#1E40AF',
    fontWeight: '700',
  },
  headerContent: {
    flex: 1,
  },
  headerTitle: {
    fontSize: 20,
    fontWeight: '700',
    color: '#0F172A',
  },
  headerSubtitle: {
    fontSize: 12,
    color: '#475569',
    marginTop: 2,
  },
  progressCard: {
    margin: 16,
    padding: 16,
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    borderWidth: 1,
    borderColor: '#E2E8F0',
  },
  progressTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: '#0F172A',
    marginBottom: 8,
  },
  progressBar: {
    height: 8,
    backgroundColor: '#E2E8F0',
    borderRadius: 4,
    overflow: 'hidden',
    marginBottom: 8,
  },
  progressFill: {
    height: '100%',
    backgroundColor: '#1E40AF',
  },
  progressText: {
    fontSize: 14,
    color: '#475569',
  },
  section: {
    paddingHorizontal: 16,
    marginTop: 16,
  },
  sectionTitle: {
    fontSize: 18,
    fontWeight: '700',
    color: '#0F172A',
    marginBottom: 12,
  },
  docCard: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 16,
    marginBottom: 12,
    borderWidth: 1,
    borderColor: '#E2E8F0',
  },
  docHeader: {
    flexDirection: 'row',
    marginBottom: 12,
  },
  docBadge: {
    width: 48,
    height: 48,
    borderRadius: 8,
    backgroundColor: '#1E40AF',
    alignItems: 'center',
    justifyContent: 'center',
    marginRight: 12,
  },
  docBadgeSuccess: {
    backgroundColor: '#10B981',
  },
  docBadgeText: {
    fontSize: 20,
    fontWeight: '700',
    color: '#FFFFFF',
  },
  docInfo: {
    flex: 1,
  },
  docTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: '#0F172A',
    marginBottom: 4,
  },
  docSubtitle: {
    fontSize: 14,
    color: '#475569',
  },
  uploadButton: {
    backgroundColor: '#1E40AF',
    borderRadius: 8,
    padding: 14,
    alignItems: 'center',
  },
  uploadButtonText: {
    fontSize: 16,
    fontWeight: '600',
    color: '#FFFFFF',
  },
  uploadedBox: {
    backgroundColor: '#F8FAFC',
    borderRadius: 8,
    padding: 12,
  },
  uploadedText: {
    fontSize: 14,
    fontWeight: '600',
    color: '#0F172A',
    marginBottom: 4,
  },
  uploadedMeta: {
    fontSize: 12,
    color: '#475569',
    marginBottom: 12,
  },
  buttonRow: {
    flexDirection: 'row',
    gap: 8,
  },
  smallButton: {
    flex: 1,
    padding: 10,
    borderRadius: 6,
    borderWidth: 1,
    borderColor: '#1E40AF',
    alignItems: 'center',
  },
  smallButtonDanger: {
    borderColor: '#EF4444',
  },
  smallButtonText: {
    fontSize: 14,
    fontWeight: '600',
    color: '#1E40AF',
  },
  smallButtonTextDanger: {
    color: '#EF4444',
  },
  continueButton: {
    backgroundColor: '#1E40AF',
    borderRadius: 12,
    padding: 16,
    alignItems: 'center',
  },
  continueButtonDisabled: {
    backgroundColor: '#CBD5E1',
  },
  continueButtonText: {
    fontSize: 16,
    fontWeight: '600',
    color: '#FFFFFF',
  },
});

export default DocumentUploadScreen;
